import React, { useEffect, useState } from 'react';
import axios from "axios";

const Result = () => {

    const [document,setDocument]=useState([]);
    console.log("test");
    useEffect(()=>{
        axios.get("kar/auteur").then((res)=>setDocument(res.data))
     
    },[])

    return (
        <div className="Result" align="center">
            <h1> Liste des resultat</h1>
            <div className="container">
                <div className="row">
                    <div className="p-2 col-2 border border-primary rounded" >
                    FILTRE
                    </div>
                    <div className=" border border-primary rounded col-10">
                    RESULTAT

                    <div className="card">

                    <h5 className="card-header">Featured</h5>
                        <div className="card-body">
                            <h5 className="card-title">Special title treatment</h5>
                            <p className="card-text">With supporting text below as a natural lead-in to additional content.</p>
                            <a href="#" className="btn btn-primary">Go somewhere</a>
                        </div>
                    </div>
                    <br></br>
                  {document.map(doc=> <p>{doc.auteur}</p>)}

                  
                    </div>
                </div>
                </div>
             </div>
    );
};

export default Result;
